import React from "react";
import "./index.scss";
const PostList = ({ post }) => {
  console.log(post);
  return (
    <>
      <div className="posts-list">
        <div className="post-list-desc">
          <div className="post-list-image">
            <img class="post-image" src="./assets/img/pretty.jpeg" alt="img" />
          </div>
          <div className="post-list-title">
            <span className="post-list-author"></span>
          </div>
        </div>
      </div>
    </>
  );
};

export default PostList;
